const nodemailer = require("nodemailer");
const { readFileSync } = require("fs");

let reserveEmail = readFileSync("./emails/reserve.html", "utf-8");

require("dotenv").config();

async function reserveMail(clientName, clientEmail) {
  try {
    const code = reserveEmail.replace("{{clientName}}", clientName);

    let transporter = nodemailer.createTransport({
      service: "gmail",
      port: 587,
      auth: {
        user: process.env.email,
        pass: process.env.email_password,
      },
    });

    let message = {
      from: process.env.email,
      to: clientEmail,
      subject: "Reservation Successful",
      html: code,
      attachments: [
        {
          filename: "logo.png",
          cid: "uniqzzue3423423@kre234234ata.e234234e",
          path: "data:image/jpeg;base64,",
        },
      ],
    };

    // send mail
    try {
      await transporter.sendMail(message);
      return {
        success: true,
        message: `We've sent an email to ${clientEmail}.`,
      };
    } catch (error) {
      console.log(error);
      return {
        success: false,
        error: `Could not send email to ${clientEmail}`,
      };
    }
  } catch (err) {
    console.log(err);
  }
}

module.exports = reserveMail;
